import React from "react";
import "../button.css";
import "../fontawesome.css";

const Button = (props) => {
  return (
    <button onClick={() => props.handleClick(!props.status)}>
      <i class="fas fa-user-plus"></i>

      {props.buttonText}
    </button>
  );
};

export default Button;
